svg.script:
clock4 = {

  menu: {
    'Tick': {
      eventName: 'clock_tick',
      applicable: (elem) => {
        return elem.querySelector('#pie10').style['opacity'] !== '1'
      },
      uiLabel: (elem) => { return 'Tick clock forward' },
      handler: function(evt) {
        clock.tick_handler(this)
      },
    },
    'Untick': {
      eventName: 'clock_untick',
      applicable: (elem) => {
        return elem.querySelector('#pie1').style['opacity'] === '1'
      },
      uiLabel: (elem) => { return 'Tick clock backward' },
      handler: function(evt) {
        clock.untick_handler(this)
      },
    },
  },

  initialize: function(elem, prototype) {
    return clock.initialize(elem, prototype)
  },

}
